INSERT INTO `diary` VALUES (1,'2023-04-04 12:48:03.278587','2023-04-04 12:48:03.278587','아픈 딸 때문에 언제나 노심초사하는 엄마. 손 한 번 잡아보았네요. 엄마 마음 쓰이게 해서 미안. 오래오래 같이 살아요. ','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/6584399e-56b4-4437-b7db-f0c954a7b58d_2.jpeg','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/c1129ae6-72a8-43f3-b62c-9c10701b3556_record.m4a',17,1,1),(2,'2023-04-01 18:06:40.135162','2023-04-01 18:06:40.135162','갑상선암 환우 회원분들과 함께 할 수 있어 힘을 얻을 수 있었고, 나 자신이 처해있는 상황을 받아들이고 나 자신이 나아가야 할 방법을 찾아봐야 할 것 같다.','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/diary_default_image/1.jpeg','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/%EB%B0%B1%EC%A0%95%EC%9D%80_1.m4a',42,3,5),(3,'2023-04-02 18:06:40.135162','2023-04-02 18:06:40.135162','올 한 해를 잘 살았으니 2023도에는 평범한 삶을 살고 싶습니다. 느근한 삶보다 바쁜 일상을 살고 싶기도 하고요. 힘내자.','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/diary_default_image/2.jpeg','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/%EB%B0%B1%EC%A0%95%EC%9D%80_10.m4a',NULL,5,5),(5,'2023-04-04 18:06:40.135162','2023-04-04 18:06:40.135162','무거운 마음을 안고 병원을 들어서는데 긴장을 풀어주신다고 고맙고 감사하단말을 전해봅니다.','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/diary_default_image/4.jpg','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/%EB%B0%B1%EC%A0%95%EC%9D%80_3.m4a',NULL,3,5),(6,'2023-04-05 18:06:40.135162','2023-04-05 18:06:40.135162','공허한 말은 삼가고 마음에서 우러나오는 실다운 따듯한 말을 하려고 노력한다.','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/diary_default_image/5.jpg','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/%EB%B0%B1%EC%A0%95%EC%9D%80_4.m4a',42,5,5),(7,'2023-03-19 18:06:40.135162','2023-03-19 18:06:40.135162','항암 치료에 대해 열심히 공부하자. 나쁜 습관을 버리고 건강한 습관을 가지려 조금씩 실천하자.','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/diary_default_image/6.jpg','https://bje-s3-bucket.s3.ap-northeast-2.amazonaws.com/%EB%B0%B1%EC%A0%95%EC%9D%80_5.m4a',NULL,5,5),(8,'2023-03-25 18:06:40.135162','2023-03-25 18:06:40.135162','삶에 부끄럽지 않으며 젖 먹던 힘까지 내며 노력하자.','https:/